import React from 'react'

function landingPage() {
  return (
    <div className='w-full h-screen bg-zinc-900 pt-1'>
        <div className='textstructure mt-40 px-20'>
            {["We Create","Eye Opening","Presentations"].map((item,index)=>(
                <div key={index} className='masker'>
                <h1 className="uppercase text-[9vw] leading-[7vw] font-semibold font-founders-grotesk">
                    {item}
                </h1>
                </div>
            ))}
        </div>
        <div className='border-t-[1px] border-zinc-600 mt-32 flex justify-between items-center py-5 px-20'>
            {["For public and private companies", "From the first pitch to IPO",].map((item,index)=>(
                <p className='text-md font-light tracking-tighter leading-none'>{item}</p>
            ))}
            <div className='start'>
                <div className='px-4 py-2 border-[2px] border-zinc-500 rounded-full'>
                    START THE PROJECT
                </div>
            </div>
        </div>
    </div>
  )
}

export default landingPage
